r, it will not be possible to change the icon or shape.\\nIf you chose the unlimited plan, there is no time limit for making changes to your logo. It is also possible to change all elements of your logo.\\nIf you chose the Privilege plan, you can create as many logos as you want with all of your brand elements included.\"},\"updateLogo\":{\"q\":\"Can I update my logo?\",\"a\":\"Yes it is possible. Log in to your freelogodesign account to make changes to your logo. please note, however, that depending on the plan you choose there may be a time limit or an action limit. for example, only the unlimited plan allows you to change all elements of your logo without time limits.\"},\"ownLogo\":{\"q\":\"Do I own my logo?\",\"a\":\"As the legal owner of your logo files, you own all copyright to the logo as a whole, but not to individual elements (for example, symbols).\\nIf you are interested in registering your logo, please contact your country's trademark protection agency to begin the process.\"}}},\"checkout\":{\"meta\":{\"title\":\"Checkout | FreeLogoDesign\",\"description\":\"Checkout\"},\"addons\":{\"title\":\"Bring your brand to life with these add-ons\",\"description\":\"Establish your brand and give a professional look to your business with high-resolution files. Get business card designs, a brand guide, and much more!\",\"add\":\"Add\",\"remove\":\"Remove\",\"addonsList\":{\"business_cards\":{\"title\":\"Business Cards\",\"description\":\"Choose from 20 customized templates with your logo and brand colors\"},\"brand_guidelines\":{\"title\":\"Brand Guidelines\",\"description\":\"Choose from 20 customized templates with your logo and brand colors\"},\"email_signature\":{\"title\":\"Email signature\",\"description\":\"Choose from 20 customized templates with your logo and brand colors\"},\"social\":{\"title\":\"Social\",\"description\":\"Choose from 20 customized templates with your logo and brand colors\"}}},\"checkout\":{\"title\":\"Payment informations\",\"descript
